  \"2013-03-19T00:33:07.724225\",\n\t\"name\": \"major-oxide-minor-oxide-trace-element-and-geochemical-data-from-rocks-collected-in-the-ala-2007\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Alaska Division of Geological & Geophysical
  Surveys (DGGS) personnel collected rock samples while mapping the bedrock geology
  along a 12-mile-wide swath following the Alaska Highway between Delta Junction and
  the eastern edge of the Mount Hayes quadrangle near Dot Lake, Alaska. This mapping
  is one component of the multi-year DGGS project studying the geology, geohazards
  and resources along the proposed gas pipeline corridor from Delta Junction to the
  Canadian border. In 2006, we collected 10 samples for whole rock (major- and minor-oxides,
  and petrogenetically important trace-elements) analysis. In 2007, we collected 111
  samples for whole rock analysis and 36 rock samples for geochemical trace-element
  analysis. Analytical data from these rock samples are tabulated in this publication.\",\n\t\"license_title\":
